import React from 'react';

const ContactCTA = () => (
  <section id="contact-cta" className="py-16 bg-black text-white text-center">
    <div className="max-w-2xl mx-auto px-4">
      <h2 className="text-3xl md:text-4xl font-bold mb-4">Ready to Dominate Your Local Market?</h2>
      <p className="mb-8 text-lg text-gray-300">Book a free strategy call and see how Rankly360 can help you win more local leads through Google Maps.</p>
      <a
        href="#contact"
        className="inline-block bg-orange-500 hover:bg-orange-600 text-white font-semibold py-3 px-8 rounded-full text-lg shadow-lg transition-all duration-200"
      >
        Book Your Free Strategy Call
      </a>
    </div>
  </section>
);

export default ContactCTA;
